from math import gcd, sqrt

def g(a, b):
    return gcd(a, b) - a * b // gcd(a, b)

def f(N):
    min_g_value = float('inf')
    for a in range(1, N // 2 + 1):
        b = N - a
        current_g = g(a, b)
        if current_g < min_g_value:
            min_g_value = current_g
    return min_g_value

def snek(x):
    if x == 1:
        return 1
    ans = 2
    for i in range(2, int(sqrt(x)) + 1):
        if x % i == 0:
            ans += 1
            d = x // i
            if d != i:
                ans += 1
    return ans

def count_pairs_with_min_g(N):
    d = snek(N) - 1
    ans = 2 * d
    if N % 2 == 0:
        ans -= 1
    return ans

